import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Header from './components/Header/Header';
import Home from './components/Home/Home';

function App() {
  return (

    <Router>
      <Header></Header>
      <Switch>
        <Route path="/home">
          <Home />
        </Route>

      </Switch>
    </Router>

  );
}

export default App;
